import emailjs from 'emailjs-com';

const ContactMe = () => {
    function sendEmail(e){
        e.preventDefault();
        emailjs.sendForm(
            'service_qrpghkh',
            'template_wxab6mf', 
            e.target, 
            'user_kmK9IfaOprdkk54lRTNeG'
            ).then(res=>{
                console.log(res);
            }).catch(err=> console.log(err)); 
        e.target.reset();
    }

    return (
        <div className="container border">
            <h1>Contact Me</h1>
            <form onSubmit={sendEmail}>
                <label>
                    Name
                </label>
                <input type="text" name="name">
                </input>
                <label>
                    Email
                </label>
                <input type="email" name="user_email">
                </input>
                <label>
                    Message
                </label>
                <textarea name="message" rows="4">
                </textarea>
                <input type='submit' value='send'/>

            </form>
            <div class="background">
          <div>
        <h1 class="contactheadline">Contact Us</h1>
        <form
          onSubmit={this.submitForm}
          action="https://formspree.io/xvowylyy"
          method="POST"
        >

          <input type="email" name="email" class="contactform" placeholder="Email" />
          <br />
          <textarea type="text" name="message" class="contactform" placeholder="Message"/>
