          {status === "SUCCESS" ? <p>Thanks!</p> : <button class="btncu">Submit</button>}
          {status === "ERROR" && <p>Ooops! There was an error.</p>}
        </form>
        </div>
      </div>
        </div>
    )
}

export default ContactMe;
